import React from "react";
import styled from "styled-components";

const HeaderWrapper = styled.header`
  display: flex;
  gap: 72px;
`;

const Logo = styled.div`
  display: flex;
`;

const Header = () => {
  return <HeaderWrapper></HeaderWrapper>;
};

export default Header;
